import './App.css';
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';
import DogList from './components/DogList';
import DogDetails from './components/DogDetails'; // Ensure this is imported if you have a DogDetails component

function App() {
  return (
    <Router>
      <div className="App">
        <h1>Good luck!</h1>
        <Routes>
          <Route exact path="/dogs" element={<DogList />} />
          <Route path="/dogs/:name" element={<DogDetails />} />
          {/* This will handle unknown routes and redirect to /dogs */}
          <Route path="*" element={<Navigate to="/dogs" />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
